function initMap(){var e=new google.maps.DirectionsService,t=new google.maps.DirectionsRenderer,n=new google.maps.Map(document.getElementById("map"),{zoom:7,center:{lat:41.85,lng:-87.65}});t.setMap(n);var o=function(){calculateAndDisplayRoute(e,t)};document.getElementById("start").addEventListener("change",o),document.getElementById("end").addEventListener("change",o)}function calculateAndDisplayRoute(e,t){e.route({origin:document.getElementById("start").value,destination:document.getElementById("end").value,travelMode:"DRIVING"},function(e,n){"OK"===n?t.setDirections(e):window.alert("Directions request failed due to "+n)})}$(document).ready(function(){$("select").material_select(),$(".datepicker").pickadate({selectMonths:!0,selectYears:15})}),$(document).ready(function(){$(".slider").slider({full_width:!0})}),$(document).ready(function(){$(".tooltipped").tooltip({delay:50}),$("#range").ionRangeSlider({hide_min_max:!0,keyboard:!0,min:0,max:5e4,from:6e3,to:5e4,type:"double",step:1,prefix:"$",grid:!0})});